import PNG from 'pngjs';

export const flagImageSources: Record<string, PNG> = {
    'fr': require('./flags/fr.png'),
    'de': require('./flags/de.png'),
    'ru': require('./flags/ru.png'),
    'es': require('./flags/es.png'),
    'th': require('./flags/th.png')
}
